@templarzq  Do you have reproducible example? 
Does it work before 20.6?
Do you expect that joinGet have to return something instead of 0 in case of `left` ?

OK. And how to reproduce it?

@templarzq 
```

create table T1 Engine=MergeTree order by tuple() as select intDiv(number,1000) tid from numbers(1000000);
create table T2 Engine=Join(any, left,tid) as select number%1000+5 id, intDiv(number,1000)+100 tid from numbers(1000000);

select joinGet('db.T2','id',tid) as nodeId,count() from T1 where tid='333' group by nodeId
┌─nodeId─┬─count()─┐
│      5 │    1000 │
└────────┴─────────┘
```

create table T1 on cluster bench_cluster Engine=MergeTree order by tuple() as select intDiv(number,1000) tid from numbers(1000000);
create table T2 on cluster bench_cluster(
  id UInt32,
  tid UInt64
) Engine=Join(any, left,tid);
insert into T2 select number%1000+5 id, intDiv(number,1000)+100 tid from numbers(1000000);
create table T3 on cluster bench_cluster as T1   ENGINE  = Distributed(bench_cluster, default,  T1, sipHash64(tid)); 


select joinGet('default.T2','id',tid) as nodeId,count(*) from T3 where tid='333' group by nodeId
